package com.samsungsds.analyst.code.node_modules.eslint;

public class ESLintResultFile {
    private String filePath;
    private ESLintResultMessages[] messages;
    private int errorCount;
    private int warningCount;
    @SuppressWarnings("unused")
    private int fixableErrorCount;
    @SuppressWarnings("unused")
    private int fixableWarningCount;
    @SuppressWarnings("unused")
    private String source;

    public String getFilePath() {
        return filePath;
    }

    public void setFilePath(String filePath) {
        this.filePath = filePath;
    }

    public ESLintResultMessages[] getMessages() {
        return messages;
    }

    public void setMessages(ESLintResultMessages[] messages) {
        this.messages = messages;
    }

    public int getErrorCount() {
        return errorCount;
    }

    public void setErrorCount(int errorCount) {
        this.errorCount = errorCount;
    }

    public int getWarningCount() {
        return warningCount;
    }

    public void setWarningCount(int warningCount) {
        this.warningCount = warningCount;
    }
}
